import React, { useState, useEffect } from 'react';
import { 
  Plus, 
  Edit, 
  Trash, 
  Search, 
  X, 
  Check,
  Car,
  Calendar,
  Activity
} from 'lucide-react';
import { getAllVehicles, createVehicle, updateVehicle, deleteVehicle } from '../../services/adminApi';

const VehicleManagement = () => {
  const [vehicles, setVehicles] = useState([]);
  const [loading, setLoading] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');
  const [showAddModal, setShowAddModal] = useState(false);
  const [showEditModal, setShowEditModal] = useState(false);
  const [currentVehicle, setCurrentVehicle] = useState(null);
  const [formData, setFormData] = useState({
    registrationNumber: '',
    model: '',
    capacity: '',
    vehicleType: 'bus',
    mileage: 0,
    lastServiceDate: '',
    status: 'active'
  });

  // 加载所有车辆
  const loadVehicles = async () => {
    setLoading(true);
    try {
      const response = await getAllVehicles();
      if (response.success) {
        setVehicles(response.data);
      } else {
        alert('Failed to load vehicles: ' + (response.error || 'Unknown error'));
      }
    } catch (error) {
      console.error('Error loading vehicles:', error);
      alert('An error occurred while loading vehicles');
    } finally {
      setLoading(false);
    }
  };

  // 初始化加载
  useEffect(() => {
    loadVehicles();
  }, []);

  // 过滤车辆
  const filteredVehicles = vehicles.filter(vehicle => 
    vehicle.registrationNumber?.toLowerCase().includes(searchTerm.toLowerCase()) ||
    vehicle.model?.toLowerCase().includes(searchTerm.toLowerCase())
  );

  // 表单处理
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  // 打开添加模态框
  const openAddModal = () => {
    setFormData({
      registrationNumber: '',
      model: '',
      capacity: '',
      vehicleType: 'bus',
      mileage: 0,
      lastServiceDate: '',
      status: 'active'
    });
    setShowAddModal(true);
  };

  // 打开编辑模态框
  const openEditModal = (vehicle) => {
    setCurrentVehicle(vehicle);
    setFormData({
      registrationNumber: vehicle.registrationNumber || '',
      model: vehicle.model || '',
      capacity: vehicle.capacity || '',
      vehicleType: vehicle.vehicleType || 'bus',
      mileage: vehicle.mileage || 0,
      lastServiceDate: vehicle.lastServiceDate || '',
      status: vehicle.status || 'active'
    });
    setShowEditModal(true);
  };

  // 添加车辆
  const handleAddVehicle = async () => {
    if (!formData.registrationNumber || !formData.model || !formData.capacity) {
      alert('Registration number, model, and capacity are required');
      return;
    }

    setLoading(true);
    try {
      const response = await createVehicle(formData);
      if (response.success) {
        setShowAddModal(false);
        loadVehicles();
        alert('Vehicle added successfully');
      } else {
        alert('Failed to add vehicle: ' + (response.error || 'Unknown error'));
      }
    } catch (error) {
      console.error('Error adding vehicle:', error);
      alert('An error occurred while adding the vehicle');
    } finally {
      setLoading(false);
    }
  };

  // 更新车辆
  const handleUpdateVehicle = async () => {
    if (!currentVehicle || !currentVehicle.id) {
      alert('No vehicle selected for update');
      return;
    }

    if (!formData.registrationNumber || !formData.model || !formData.capacity) {
      alert('Registration number, model, and capacity are required');
      return;
    }

    setLoading(true);
    try {
      const response = await updateVehicle(currentVehicle.id, formData);
      if (response.success) {
        setShowEditModal(false);
        loadVehicles();
        alert('Vehicle updated successfully');
      } else {
        alert('Failed to update vehicle: ' + (response.error || 'Unknown error'));
      }
    } catch (error) {
      console.error('Error updating vehicle:', error);
      alert('An error occurred while updating the vehicle');
    } finally {
      setLoading(false);
    }
  };

  // 删除车辆
  const handleDeleteVehicle = async (vehicleId) => {
    if (!window.confirm('Are you sure you want to delete this vehicle? This action cannot be undone.')) {
      return;
    }

    setLoading(true);
    try {
      const response = await deleteVehicle(vehicleId);
      if (response.success) {
        loadVehicles();
        alert('Vehicle deleted successfully');
      } else {
        alert('Failed to delete vehicle: ' + (response.error || 'Unknown error'));
      }
    } catch (error) {
      console.error('Error deleting vehicle:', error);
      alert('An error occurred while deleting the vehicle');
    } finally {
      setLoading(false);
    }
  };

  // 车辆表单模态框
  const VehicleFormModal = ({ isAdd, onClose, onSubmit }) => (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
      <div className="bg-white rounded-lg p-6 w-full max-w-2xl">
        <div className="flex justify-between items-center mb-4">
          <h3 className="text-lg font-semibold">
            {isAdd ? 'Add New Vehicle' : 'Edit Vehicle'}
          </h3>
          <button 
            onClick={onClose}
            className="text-gray-400 hover:text-gray-600"
          >
            <X className="w-5 h-5" />
          </button>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Registration Number *
            </label>
            <input
              type="text"
              name="registrationNumber"
              value={formData.registrationNumber}
              onChange={handleInputChange}
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              required
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Model *
            </label>
            <input
              type="text"
              name="model"
              value={formData.model}
              onChange={handleInputChange}
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              required
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Capacity (seats) *
            </label>
            <input
              type="number"
              name="capacity"
              value={formData.capacity}
              onChange={handleInputChange}
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              required
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Vehicle Type
            </label>
            <select
              name="vehicleType"
              value={formData.vehicleType}
              onChange={handleInputChange}
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            >
              <option value="bus">Bus</option>
              <option value="minibus">Mini Bus</option>
              <option value="van">Van</option>
              <option value="car">Car</option>
            </select>
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Mileage (km)
            </label>
            <input
              type="number"
              name="mileage"
              value={formData.mileage}
              onChange={handleInputChange}
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Last Service Date
            </label>
            <input
              type="date"
              name="lastServiceDate"
              value={formData.lastServiceDate}
              onChange={handleInputChange}
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Status
            </label>
            <select
              name="status"
              value={formData.status}
              onChange={handleInputChange}
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            >
              <option value="active">Active</option>
              <option value="maintenance">Maintenance</option>
              <option value="out_of_service">Out of Service</option>
            </select>
          </div>
        </div>

        <div className="flex space-x-3 mt-6">
          <button 
            className="btn-primary flex-1 flex items-center justify-center"
            onClick={onSubmit}
            disabled={loading}
          >
            {loading ? 'Processing...' : (isAdd ? 'Add Vehicle' : 'Update Vehicle')}
          </button>
          <button 
            className="btn-secondary flex-1"
            onClick={onClose}
            disabled={loading}
          >
            Cancel
          </button>
        </div>
      </div>
    </div>
  );

  return (
    <div className="space-y-6">
      <div className="flex justify-between items-center">
        <h2 className="text-2xl font-bold text-gray-900">Vehicle Management</h2>
        <button 
          className="btn-primary flex items-center"
          onClick={openAddModal}
        >
          <Plus className="w-4 h-4 mr-2" />
          Add Vehicle
        </button>
      </div>

      {/* Search Bar */}
      <div className="relative">
        <input
          type="text"
          placeholder="Search vehicles by registration number or model..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          className="w-full px-4 py-2 pl-10 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
        />
        <Search className="w-5 h-5 text-gray-400 absolute left-3 top-2.5" />
        {searchTerm && (
          <button
            onClick={() => setSearchTerm('')}
            className="absolute right-3 top-2.5 text-gray-400 hover:text-gray-600"
          >
            <X className="w-5 h-5" />
          </button>
        )}
      </div>

      {/* Vehicles Grid */}
      {loading && !filteredVehicles.length ? (
        <div className="text-center py-10">
          <div className="spinner"></div>
          <p className="mt-2 text-gray-600">Loading vehicles...</p>
        </div>
      ) : filteredVehicles.length === 0 ? (
        <div className="text-center py-10 border border-dashed border-gray-300 rounded-lg">
          <Car className="w-12 h-12 text-gray-400 mx-auto mb-3" />
          <h3 className="text-lg font-medium text-gray-900">No vehicles found</h3>
          <p className="text-gray-500 mt-1">
            {searchTerm ? 'Try a different search term' : 'Add your first vehicle to get started'}
          </p>
          {searchTerm && (
            <button
              onClick={() => setSearchTerm('')}
              className="mt-3 text-blue-600 hover:text-blue-800"
            >
              Clear search
            </button>
          )}
        </div>
      ) : (
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {filteredVehicles.map(vehicle => (
            <div key={vehicle.id} className="card hover:shadow-md transition-shadow">
              <div className="flex items-center justify-between mb-3">
                <div className="flex items-center space-x-3">
                  <div className="w-10 h-10 bg-blue-100 rounded-full flex items-center justify-center">
                    <Car className="w-5 h-5 text-blue-600" />
                  </div>
                  <div>
                    <h3 className="font-semibold text-gray-900">{vehicle.registrationNumber}</h3>
                    <p className="text-sm text-gray-600">{vehicle.model}</p>
                  </div>
                </div>
                <div className="flex space-x-2">
                  <button 
                    onClick={() => openEditModal(vehicle)}
                    className="p-1 text-gray-500 hover:text-blue-600"
                    title="Edit vehicle"
                  >
                    <Edit className="w-4 h-4" />
                  </button>
                  <button 
                    onClick={() => handleDeleteVehicle(vehicle.id)}
                    className="p-1 text-gray-500 hover:text-red-600"
                    title="Delete vehicle"
                  >
                    <Trash className="w-4 h-4" />
                  </button>
                </div>
              </div>

              <div className="space-y-2">
                <div className="flex items-center text-sm text-gray-600">
                  <span className="font-medium">{vehicle.capacity} seats</span>
                </div>

                <div className="flex items-center text-sm text-gray-500">
                  <Activity className="w-4 h-4 mr-2" />
                  <span>{vehicle.mileage?.toLocaleString() || 0} km</span>
                </div>

                {vehicle.lastServiceDate && (
                  <div className="flex items-center text-sm text-gray-500">
                    <Calendar className="w-4 h-4 mr-2" />
                    <span>Last service: {new Date(vehicle.lastServiceDate).toLocaleDateString()}</span>
                  </div>
                )}

                <div className="flex items-center justify-between text-xs mt-2">
                  <span className="capitalize">{vehicle.vehicleType}</span>
                  <span className={`px-2 py-0.5 rounded-full flex items-center ${
                    vehicle.status === 'active' ? 'bg-green-100 text-green-800' : 
                    vehicle.status === 'maintenance' ? 'bg-yellow-100 text-yellow-800' :
                    'bg-red-100 text-red-800'
                  }`}>
                    {vehicle.status === 'active' ? (
                      <Check className="w-3 h-3 mr-1" />
                    ) : (
                      <X className="w-3 h-3 mr-1" />
                    )}
                    {vehicle.status?.replace('_', ' ')}
                  </span>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}

      {/* Add Modal */}
      {showAddModal && (
        <VehicleFormModal
          isAdd={true}
          onClose={() => setShowAddModal(false)}
          onSubmit={handleAddVehicle}
        />
      )}

      {/* Edit Modal */}
      {showEditModal && (
        <VehicleFormModal
          isAdd={false}
          onClose={() => setShowEditModal(false)}
          onSubmit={handleUpdateVehicle}
        />
      )}
    </div>
  );
};

export default VehicleManagement;
